#include <bits/stdc++.h>
using namespace std;
int main()
{
    long long int n, j = 0, k; cin >> n >> k;
    vector <long long> v (n);
    for(int i = 0; i < n; i++) cin>>v[i];
    long long int a = (n * (n + 1)) / 2;
    while (a >= k) {
        a -= (n - j);
        j++;
    }
    cout << v[k - a - 1];
}
